import Head from 'next/head';

const AboutStyles = styled.div`
  display: grid;
  grid-template-columns: 1fr 3fr 1fr;
  align-items: center;
  #form {
    grid-column: 2;
    width: 100%;
    margin-top: 10vh;
    margin-bottom: 30vh;
    padding: 25px;
    padding-right: 50px;
    border: solid black 2px;
    border-radius: 10px;
  }
  #input {
    width: 100%;
  }
`;

export default function Account() {
  return (
    <div>
      <Head>
        <title>Ataire | Account </title>
      </Head>
      <h1>About</h1>
      <p>Content</p>
    </div>
  );
}
